import React from 'react'
import { ListGroup } from 'react-bootstrap'
import { Link } from 'react-router-dom'

const Menu = () => {
  return (
    <div>
        <ListGroup>
            <Link tag="a" to="/" action>Home</Link>
        </ListGroup>
    </div>
  )
}

export default Menu
